import TailLink from "./TailLink";
import {
    Navbar,
    MobileNav,
    Typography,
    Button,
    IconButton,
    Card,
  } from "@material-tailwind/react";

const RouteNav = () => {
    const jwt = sessionStorage.getItem("jwt")

    const authen = () => {
        alert("로그인하세요")
        window.location.replace("/login")
    }

    const logout = () => {
        if (window.confirm("로그아웃하시겠습니까?")) {
            sessionStorage.removeItem("jwt")
            sessionStorage.removeItem("username")
            window.location.replace("/")
        } else {
        }
    }
    const [openNav, setOpenNav] = React.useState(false);

  React.useEffect(() => {
    window.addEventListener(
      "resize",
      () => window.innerWidth >= 960 && setOpenNav(false),
    );
  }, []);

    const navList = (
        <ul className="mt-2 mb-4 flex flex-col gap-10 lg:mb-0 lg:mt-0 lg:flex-row lg:items-center lg:gap-6">
          <Typography
            as="li"
            variant="small"
            color="blue-gray"
            className="text-xl"
          >
            <TailLink href="/" title="음식칼로리" />
          </Typography>
          <Typography
            as="li"
            variant="small"
            color="blue-gray"
            className="text-xl"
          >
            <TailLink title="나의칼로리" handleClick={authen} />
          </Typography>
        </ul>
      );

    return (
        <div className="flex max-w-screen-xl justify-between item-center p-4">
            <div>
                Diet
            </div>
            <nav>
                <TailLink href="/" title="음식칼로리" />
                {jwt === null 
                ?<><TailLink title="나의칼로리" handleClick={authen}/>
                <TailLink href="/login" title="로그인"/>
                <TailLink href="/signup" title="회원가입"/></>
                :<><TailLink href="/mycalorie" title="나의칼로리"/>
                <TailLink title="로그아웃" handleClick={logout}/>
                <TailLink href="/profile" title="프로필"/></>}
            </nav>
        </div>
    )
}

export default RouteNav
